int passwordFinder(string input)
{
    int finalResult = 0;
    string[] inputList = input.Split("\r\n");
    foreach (string rotation in inputList)
    {
        string direction = rotation.Substring(0, 1);
        string amountString = rotation.Substring(1, rotation.Length-1);
        int amount = int.Parse(amountString);
        int[] output = rotateOneByOne(amount, direction);
        currentNumber = output[0];
        finalResult += output[1];
        Console.WriteLine(currentNumber);
    }
    return finalResult;
}

int[] rotateOneByOne(int amount, string direction)
{
    int zerosToAdd = 0;
    int newNumber = currentNumber;
    if (direction == "L")
    {
        for (int i = 0; i < amount; i++)
        {
            newNumber--;
            if (newNumber < 0) 
            {
                newNumber = 99;
            }
            if (newNumber == 0) 
            { 
                zerosToAdd++;
            }
        }
    }
    else
    {
        for (int i = 0; i < amount; i++)
        {
            newNumber++;
            if (newNumber > 99)
            {
                newNumber = 0;
            }
            if (newNumber == 0)
            {
                zerosToAdd++;
            }
        }
    }
    return new int[] { newNumber, zerosToAdd };
}
int[] rotateNumber(int rotationAmount, string rotationDirection)
{
    bool clickedPast = false;
    int zerosToAdd = 0;
    int newNumber = currentNumber;
    if (rotationDirection == "L")
    {
        newNumber -= rotationAmount;
    }
    else
    {
        newNumber += rotationAmount;
    }
    while (newNumber < 0) 
    { 
        newNumber += 100;
        clickedPast = true;
        zerosToAdd++;
        //Console.WriteLine("Add by click");
    }
    while (newNumber > 99)
    {
        zerosToAdd++;
        newNumber -= 100;
        clickedPast = true;
        
        //Console.WriteLine("Add by click");
    }
    if (newNumber == 0 & !clickedPast) 
    {
        zerosToAdd = 1;
    }
    if (clickedPast & currentNumber == 0) 
    { 
        zerosToAdd--;
    }
    return new int[] { newNumber, zerosToAdd };
}

